import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import SkillForm from './components/SkillForm';
import RecommendationPage from './pages/RecommendationPage';
import LandingPage from './pages/LandingPage'; // Import LandingPage
import LoginPage from './pages/LoginPage';   // Import LoginPage
import './App.css';

function App() {
  const [username, setUsername] = useState(''); // State to hold the username
  const [userRatings, setUserRatings] = useState(null);

  return (
    <Router>
      <Routes>
        <Route path="/" element={<LandingPage />} /> {/* LandingPage on the root path */}
        <Route path="/login" element={<LoginPage setUsername={setUsername} />} /> {/* LoginPage */}
        <Route path="/skill-assessment" element={<SkillForm username={username} setUserRatings={setUserRatings} />} /> {/* SkillForm with username */}
        <Route path="/recommendations" element={<RecommendationPage userRatings={userRatings} />} />
      </Routes>
    </Router>
  );
}

export default App;
